import React from "react"
import classes from "./MenuToggle.module.css"

const MenuToggle = props =>{
	const cls = ["fa", classes.MenuToggle];

	if(props.isOpen){
		cls.push("fa-times");
		cls.push("open")
	}

	return(
		<i></i>
	)
}

export default MenuToggle
